The simplest way of representing a table is to just put it in a text file. Even for this, there are many ways you could choose to do it, but probably the most common way is using comma-separated-values (CSV). Each row of text will represent one item, where the attributes of that item are separated by commas. Typically, the first row of text in the file will be the names of the columns (attributes): name,age,fav_icecream
Bob,24,chocolate
Alice,31,vanilla
John,48,strawberry Note: sometimes this can be hard to read visually due to the mis-alignment of columns. If you're using VSCode (or something similar) you can install add-ons that color your CSV to make the columns clearer (or add spacing to align them). Since a .csv file is just a text file, we can read it as we would normally read any text file in Python (with the open() function). But turning that text into other data structures (lists/dictionaries) is so common that Python has a built-in CSV reader!: import csv with open('mydata.csv') as csvfile: rows = csv.reader(csvfile) for r in rows: print(r) # r is a list of the values # [value1, value2, ...] So in one go, we've turned the CSV file full of text into a list of lists , containing our data! NOTE: You can also read files with separators other than a comma: rows = csv.reader(csvfile, delimiter=';') The CSV format is more general than the specific use-case we're talking about here (tabular data) - it's really just a way of storing lists of values in rows! For the specific use-case of tabular data (i.e. items in rows, with attributes in columns, and a starting row of column names) there's a specific tool that we'll use from the csv module: with open('mydata.csv') as csvfile: # here's the magic step: rows = list(csv.DictReader(csvfile)) for r in rows: print(r) # r is now a dictionary! # { column_name: attribute, ... } So now, we've turned our text (CSV) representation of a table... into a list of dictionaries !!! Each dictionary represents one full "Person", with all of their attributes. It looks like this: [ { "name": "Bob", "age": 24, "fav_icecream": "chocolate" }, { "name": "Alice", "age": 31, "fav_icecream": "vanilla" }, { "name": "John", "age": 48, "fav_icecream": "strawberry"}
]
